PRAGMA synchronous = OFF;
PRAGMA journal_mode = MEMORY;
BEGIN TRANSACTION;
CREATE TABLE "backup" (
  "idx" integer NOT NULL ,
  "filename" varchar(100) DEFAULT NULL,
  "dbname" varchar(20) DEFAULT NULL,
  "username" varchar(40) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "colorcodes" (
  "idx" integer NOT NULL ,
  "neuron" varchar(10) DEFAULT NULL,
  "color" varchar(10) DEFAULT NULL,
  "worm" varchar(10) DEFAULT NULL,
  "series" varchar(10) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "combineflag" (
  "idx" integer NOT NULL ,
  "synid1" integer DEFAULT NULL,
  "syn1" varchar(100) DEFAULT NULL,
  "synid2" integer DEFAULT NULL,
  "syn2" varchar(100) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "contin" (
  "continID" integer  NOT NULL ,
  "sectionNum1" integer NOT NULL DEFAULT '0',
  "sectionNum2" integer NOT NULL DEFAULT '0',
  "CON_Number" integer  NOT NULL DEFAULT '0',
  "CON_AlternateName" varchar(250) DEFAULT NULL,
  "CON_AlternateName2" varchar(20) DEFAULT NULL,
  "CON_Remarks" varchar(254) DEFAULT NULL,
  "type" varchar(30) DEFAULT 'neuron',
  "series" varchar(30) DEFAULT NULL,
  "count" integer DEFAULT '0',
  PRIMARY KEY ("continID")
);
CREATE TABLE "continmap" (
  "idx" integer NOT NULL ,
  "continName" varchar(30) DEFAULT NULL,
  "continNum" integer DEFAULT NULL,
  "series" varchar(30) DEFAULT NULL,
  "direction" varchar(30) DEFAULT NULL,
  "zoom" integer DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "contintable" (
  "continName" varchar(20) DEFAULT NULL,
  "continNum" integer DEFAULT NULL,
  "calculated" text  DEFAULT NULL,
  "printed" text  DEFAULT NULL
);
CREATE TABLE "cumulativelist" (
  "idx" integer NOT NULL ,
  "neuron" varchar(10) DEFAULT NULL,
  "partner" varchar(10) DEFAULT NULL,
  "type" varchar(10) DEFAULT NULL,
  "length" integer DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "degree" (
  "neuron" varchar(20) DEFAULT NULL,
  "DegreeE" integer DEFAULT NULL,
  "DegreeIn" integer DEFAULT NULL,
  "DegreeOut" integer DEFAULT NULL,
  "SectionE" integer DEFAULT NULL,
  "SectionIn" integer DEFAULT NULL,
  "SectionOut" integer DEFAULT NULL
);
CREATE TABLE "display" (
  "x" integer DEFAULT NULL,
  "y" integer DEFAULT NULL,
  "z" integer DEFAULT NULL,
  "cellbody" integer DEFAULT NULL,
  "remarks" varchar(40) DEFAULT NULL,
  "continNum" integer DEFAULT NULL,
  "segmentNum" integer DEFAULT NULL,
  "idx" integer NOT NULL ,
  "branch" integer DEFAULT '0',
  "objName" varchar(20) DEFAULT NULL,
  "series" varchar(30) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "display2" (
  "x1" integer DEFAULT NULL,
  "y1" integer DEFAULT NULL,
  "z1" integer DEFAULT NULL,
  "cellbody1" integer DEFAULT NULL,
  "remarks1" varchar(40) DEFAULT NULL,
  "continNum" integer DEFAULT NULL,
  "segmentNum" integer DEFAULT NULL,
  "idx" integer NOT NULL ,
  "branch1" integer DEFAULT '0',
  "objName1" varchar(20) DEFAULT NULL,
  "series1" varchar(30) DEFAULT NULL,
  "x2" integer DEFAULT NULL,
  "y2" integer DEFAULT NULL,
  "z2" integer DEFAULT NULL,
  "cellbody2" integer DEFAULT NULL,
  "remarks2" varchar(40) DEFAULT NULL,
  "branch2" integer DEFAULT '0',
  "objName2" varchar(20) DEFAULT NULL,
  "series2" varchar(30) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "edge" (
  "name" varchar(20) DEFAULT NULL,
  "abbrname" varchar(20) DEFAULT NULL,
  "defini" varchar(100) DEFAULT NULL
);
CREATE TABLE "etest" (
  "idx" integer NOT NULL ,
  "x" integer DEFAULT '0',
  "y" integer DEFAULT '0',
  "IMG_Number" varchar(30) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "image" (
  "ID" integer  NOT NULL ,
  "IMG_Number" varchar(30) NOT NULL DEFAULT '',
  "IMG_File" varchar(30) NOT NULL DEFAULT '',
  "IMG_Directory" varchar(50) NOT NULL DEFAULT '',
  "IMG_Worm" varchar(254) NOT NULL DEFAULT '',
  "IMG_Series" varchar(30) NOT NULL DEFAULT '',
  "IMG_PrintNumber" varchar(30) NOT NULL DEFAULT '',
  "IMG_NegativeNumber" varchar(30) NOT NULL DEFAULT '',
  "IMG_SectionNumber" integer NOT NULL DEFAULT '0',
  "IMG_EnteredBy" varchar(50) NOT NULL DEFAULT '',
  "IMG_DateEntered" date NOT NULL DEFAULT '0000-00-00',
  "IMG_zoomValue" double NOT NULL DEFAULT '1',
  "IMG_brightnessValue" integer NOT NULL DEFAULT '0',
  "IMG_contrastValue" integer NOT NULL DEFAULT '0',
  "IMG_rotatedValue" double NOT NULL DEFAULT '0',
  "IMG_Remarks" varchar(254) DEFAULT NULL,
  "IMG_originX" integer NOT NULL DEFAULT '0',
  "IMG_originY" integer NOT NULL DEFAULT '0',
  PRIMARY KEY ("ID")
);
CREATE TABLE "imagesize" (
  "idx" integer NOT NULL ,
  "IMG_Number" varchar(30) DEFAULT NULL,
  "width" integer DEFAULT '0',
  "height" integer DEFAULT '0',
  PRIMARY KEY ("idx")
);
CREATE TABLE "list" (
  "Neuron" varchar(25) DEFAULT NULL,
  "Type" varchar(50) DEFAULT NULL,
  "PresentInHermaphrodite" integer DEFAULT NULL,
  "LocationOfCellBody" varchar(50) DEFAULT NULL,
  "ProcessInPosterior" integer DEFAULT NULL,
  "Reconstructed" integer DEFAULT NULL,
  "memo" mediumtext
);
CREATE TABLE "lockcontin" (
  "idx" integer NOT NULL ,
  "continNum" integer DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "matrix" (
  "name" varchar(40) DEFAULT NULL,
  "idx" integer NOT NULL ,
  "type" varchar(30) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "multiple" (
  "OBJ_Name" integer DEFAULT NULL,
  "fromObj" integer DEFAULT '0',
  "toObj1" integer DEFAULT '0',
  "toObj2" integer DEFAULT '0',
  "toObj3" integer DEFAULT '0',
  "toObj4" integer DEFAULT '0',
  "toObj5" integer DEFAULT '0'
);
CREATE TABLE "nattr" (
  "name" varchar(20) DEFAULT NULL,
  "title" varchar(20) DEFAULT NULL,
  "subtitle" varchar(20) DEFAULT NULL,
  "attr_value" integer DEFAULT NULL,
  "display" varchar(20) DEFAULT NULL
);
CREATE TABLE "nbdata" (
  "idx" integer NOT NULL ,
  "n1" varchar(20) DEFAULT NULL,
  "n2" varchar(20) DEFAULT NULL,
  "type" varchar(10) DEFAULT NULL,
  "section" integer DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "neighborhood" (
  "idx" integer NOT NULL ,
  "OBJ_Name" integer DEFAULT NULL,
  "neuron" varchar(20) DEFAULT NULL,
  "neighbors" varchar(100) DEFAULT NULL,
  "neighborNum" integer DEFAULT NULL,
  "imgNum" varchar(20) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "network" (
  "pre" varchar(10) DEFAULT NULL,
  "post" varchar(10) DEFAULT NULL,
  "weight" integer DEFAULT NULL,
  "idx" integer NOT NULL ,
  "pp" varchar(30) DEFAULT NULL,
  PRIMARY KEY ("idx")
);
CREATE TABLE "network2" (
  "pre" integer DEFAULT NULL,
  "post" integer DEFAULT NULL,
  "weight" integer DEFAULT NULL
);
CREATE TABLE "network3" (
  "n1" varchar(40) DEFAULT NULL,
  "n2" varchar(40) DEFAULT NULL,
  "direction" integer DEFAULT NULL,
  "method" varchar(10) DEFAULT NULL,
  "weight" double DEFAULT NULL
);
CREATE TABLE "neurontable" (
  "name" varchar(40) DEFAULT NULL,
  "continNum" varchar(40) DEFAULT NULL,
  "type" varchar(40) DEFAULT NULL
);
CREATE TABLE "obj2" (
  "name" integer NOT NULL DEFAULT '0',
  "x" integer DEFAULT NULL,
  "y" integer DEFAULT NULL,
  "directory" varchar(100) DEFAULT NULL,
  "filename" varchar(40) DEFAULT NULL,
  PRIMARY KEY ("name")
);
CREATE TABLE "obj3" (
  "name" integer DEFAULT NULL,
  "x" integer DEFAULT NULL,
  "y" integer DEFAULT NULL,
  "directory" varchar(50) DEFAULT NULL,
  "filename" varchar(40) DEFAULT NULL
);
CREATE TABLE "object" (
  "OBJ_Name" integer  NOT NULL ,
  "OBJ_X" integer  NOT NULL DEFAULT '0',
  "OBJ_Y" integer  NOT NULL DEFAULT '0',
  "OBJ_Remarks" varchar(254) DEFAULT NULL,
  "IMG_Number" varchar(30) NOT NULL DEFAULT '',
  "CON_Number" integer  NOT NULL DEFAULT '0',
  "type" text  NOT NULL DEFAULT 'cell',
  "fromObj" varchar(20) DEFAULT '-1',
  "toObj" varchar(60) DEFAULT '',
  "checked" integer DEFAULT '0',
  "username" varchar(10) DEFAULT NULL,
  "DateEntered" date DEFAULT '0000-00-00',
  "certainty" text  DEFAULT 'certain',
  "size" text  DEFAULT 'normal',
  "cellType" integer DEFAULT '0',
  "forMap" varchar(30) DEFAULT '',
  PRIMARY KEY ("OBJ_Name")
);
CREATE TABLE "object2" (
  "idx" integer  NOT NULL ,
  "OBJ_Name" integer  NOT NULL,
  "type" text  DEFAULT 'cell',
  "fromObj" varchar(20) DEFAULT '-1',
  "toObj" varchar(40) DEFAULT '-1',
  "username" varchar(10) DEFAULT NULL,
  "DateEntered" date DEFAULT '0000-00-00',
  "size" text  DEFAULT 'normal',
  "certainty" text  DEFAULT 'certain',
  PRIMARY KEY ("idx")
);
CREATE TABLE "records" (
  "synid" integer DEFAULT NULL,
  "IMG_Number" varchar(20) DEFAULT NULL,
  "partner1" varchar(50) DEFAULT NULL,
  "partner2" varchar(50) DEFAULT NULL,
  "type" varchar(20) DEFAULT 'chemical'
);
CREATE TABLE "records2" (
  "synid" integer DEFAULT NULL,
  "IMG_Number" varchar(20) DEFAULT NULL,
  "partner1" varchar(50) DEFAULT NULL,
  "partner2" varchar(50) DEFAULT NULL,
  "type" varchar(20) DEFAULT 'chemical'
);
CREATE TABLE "relationship" (
  "relID" integer  NOT NULL ,
  "REL_Remarks" varchar(254) DEFAULT NULL,
