);
CREATE TABLE "reportlist2" (
  "idx" integer NOT NULL ,
  "neuron" varchar(20) DEFAULT NULL,
  "partner" varchar(20) DEFAULT NULL,
  "type" varchar(5) DEFAULT NULL,
  "length" integer DEFAULT NULL,
  PRIMARY KEY ("idx")
);
